import React from 'react'

const Header = () => {
  return (
    // 상단바 입니다.
    <header className='top'>
      {/* 상단바 좌측의 아이콘과 글씨입니다. */}
        <logo className='top_logo'>
            <a className='top_logo_text'>▼ title.title</a>
        </logo>
        {/* 상바봐 우측의 nav와 로그인 입니다. */}
        <ul className='top_nav'>
            <li className='list_Style'><a>Menu1</a></li>
            <li className='list_Style'><a>Menu2</a></li>
            <li className='list_Style'><a>Menu3</a></li>
            <li className='list_Style'><a>Menu4</a></li>
            <li className='list_Style'><a className='nav_login_btn'>Login</a></li>
        </ul>
    </header>
  )
}

export default Header
